import React from "react";
import { useNavigate } from "react-router-dom";
import * as M from "../styles/styledMemory";

const Memory = () => {
  return (
    <M.Container>
      <M.Bar>
        <M.Time></M.Time>
        <M.Connecting>
          <img
            src={`${process.env.PUBLIC_URL}/photos/Cellular Connection.svg`}
            alt="connection"
          />
        </M.Connecting>
        <M.Wifi>
          <img src={`${process.env.PUBLIC_URL}/photos/WiFi.svg`} alt="Wifi" />
        </M.Wifi>
        <M.Battery>
          <img
            src={`${process.env.PUBLIC_URL}/photos/Battery.svg`}
            alt="Battery"
          />
        </M.Battery>
      </M.Bar>
      <M.Background>
        <M.Backbtn>
          <img
            src={`${process.env.PUBLIC_URL}/photos/back.svg`}
            alt="backbtn"
          />
        </M.Backbtn>
        <M.Title />
      </M.Background>
      <M.Month></M.Month>
      <M.Date></M.Date>
    </M.Container>
  );
};

export default Memory;
